import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Forms.css';

const LoginForm = () => {
  const [formData, setFormData] = useState({
    pass_phrase: '',
    photo: null,
  });

  const [message, setMessage] = useState('');
  const [showPopup, setShowPopup] = useState(false);
  const [showLoading, setShowLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleCapture = () => {
    const video = document.createElement('video');

    // Request permission to access the camera
    navigator.mediaDevices.getUserMedia({ video: true }).then((stream) => {
      video.srcObject = stream;
      video.play();

      // Create a canvas to capture the video frame
      const canvas = document.createElement('canvas');
      const context = canvas.getContext('2d');

      // Set canvas dimensions to match the video stream
      canvas.width = video.videoWidth;
      canvas.height = video.videoHeight;

      // Capture the image when the video is ready
      video.addEventListener('loadeddata', () => {
        context.drawImage(video, 0, 0, canvas.width, canvas.height);

        // Stop the video stream
        stream.getTracks().forEach(track => track.stop());

        // Convert the canvas image to a blob and store it in the state
        canvas.toBlob((blob) => {
          setFormData({
            ...formData,
            photo: blob,
          });
        });
      });
    })
    .catch((error) => {
      console.error('Camera access denied:', error);
      setMessage('Camera access denied');
      setShowPopup(true);
    });
};

const handleSubmit = async (e) => {
  e.preventDefault();
  setShowLoading(true);

  const form = new FormData();
  form.append('pass_phrase', formData.pass_phrase);
  if (formData.photo) {
    form.append('photo', formData.photo);
  }

  try {
    const response = await fetch('http://127.0.0.1:8000/authenticate', {
      method: 'POST',
      body: form,
    });

    const result = await response.text();
    setMessage(result);

    if (response.status === 200) {
      localStorage.setItem('username', result);
      setShowPopup(true);
      setTimeout(() => {
        navigate(`/welcome/${result}`);
      }, 2000);
    } else if (result === 'Wrong passphrase') {
      setMessage('Wrong passphrase');
      setShowPopup(true);
    } else {
      setShowPopup(true);
    }
  } catch (error) {
    console.error('Error:', error);
    setMessage('An error occurred');
    setShowPopup(true);
  } finally {
    setShowLoading(false);
  }
};

return (
  <div className="main-container">
    <div className="left-side">
      <img src="/images/3dsm.png" alt="3D SMART FACTORY" className="logo" />
      <p className="mantra">Une structure mixte qui va de la recherche à la création des activités socio-économiques en créant des Startups de différents domaines</p>
    </div>
    <div className="right-side">
      <div className="form-card">
        <h2>Login</h2>
        <form onSubmit={handleSubmit}>
          <input
            type="password"
            name="pass_phrase"
            placeholder="Pass Phrase"
            value={formData.pass_phrase}
            onChange={handleChange}
            required
          />
          <button type="button" onClick={handleCapture}>Open Camera & Take Picture</button>
          <button type="submit">Login</button>
        </form>
        <p>{message}</p>

        {showLoading && (
          <div className="loading-popup">
            <p>Processing, please wait...</p>
          </div>
        )}

        {showPopup && (
          <div className="message-popup">
            <p>{message}</p>
            <button className="close-btn" onClick={() => setShowPopup(false)}>X</button>
          </div>
        )}
      </div>
    </div>
  </div>
);
};

export default LoginForm;
